import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Card from './components/Card';

export default function Priority1() {
  const [array, setArray] = useState([]);
  const [data, setData] = useState(null);

  const fetchData = async () => {
    try {
      const response = await axios.get('https://api.quicksell.co/v1/internal/frontend-assignment');
      setData(response.data.tickets);
    } catch (error) {
      console.error('Axios error:', error);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  useEffect(() => {
    if (data) {
      setArray(data);
    }
  }, [data]);

  console.log('array', array);

  return (
    <div style={{ display: 'flex', backgroundColor: 'rgb(154, 172, 178)', height: '100%' }}>
      <div style={{ width: '20%' }}>No priority</div>
      <div id="Urgent" style={{ width: '20%' }}>Urgent</div>
      <div id="High" style={{ width: '20%' }}>High</div>
      <div id="Medium" style={{ width: '20%' }}>Medium</div>
      <div id="Low" style={{ width: '20%' }}>Low</div>
    </div>
  );
}
